#include "get_field.h"

extern int get_bfield(double x, double y, double z, double *bx, double *by, double *bz, struct Cell *cell,
	void(*add_contribution_comp)(double,double,double,double*,double*,double*,struct Cell*,int))
{
	int i;
	double r, th, xwerr, ywerr, zwerr;
	//printf("nb of poles in getfield %i\n", cell->nbcomp);
	
	if(cell->boun.thmax != 0) { //circular cell
		//printf("x = %lf, y = %lf, z=%lf\n",x,y,z);
		
		r = sqrt(x*x + y*y);
		th = atan_ratio(y, x);
		//printf("r=%lf, th=%lf\n",r,th*180./PI);
		
		if(th < 0) {
			if(fabs(th)<TINYLENGTH) {
				//x = r;
				y = 0;
			}
			else if(th < atan(0.1/r) + cell->boun.thmax-2.*PI && cell->boun.thmax>1.5*PI) { //if thmax>270deg, th<0 can still be in the cell
				th = th + 2.*PI;
				printf("new th = %lf\n",th*180./PI);
			}
			else {
				printf("\nget_bfield: particle is going backward\n");
				printf("x=%le,y=%le\n",x,y);
				return LOST_BACK;
			}
		}
		if(th >= cell->boun.thmax) {
			//printf("r=%lf, th=%lf, z=%lf\n", r,th*180./PI,z);
			if(th >= 1.5*cell->boun.thmax) {
				//printf("get_bfield: ask field at a point very far out the boundaries (th > 1.5*cell->boun.thmax)\n");
				return LOST_L;
				//errorstop("!!! Error in get_bfield: ask field at a point very far out the boundaries (th > 1.5*cell->boun.thmax), you are doing something wrong!!! (Possible solution: if you are using adaptative step-size, consider to decrease STPSZ_MAXFAC, see constant.h)");
			}
			else {
				if(doyou_long_boun_sym == YES) th = 2*cell->boun.thmax - th;
				else {
					*bx=0; *by=0; *bz=0; return ALIVE;
				}
			} 
			//but if we just need the field right after the boundary, for the last tracking step:
			//we assume that this boundary is a symmetry plane in the field distribution (zero field could for instance be assume, in this case replace the lines below by: *bx = *by = *bz = 0; return ALIVE;...)
			x = r*cos(th);
			y = r*sin(th);
			//printf("newx, newy=(%le,%le)\n",x,y);
		}
	}
	else { //straight cell
		r = x;
		//printf("x=%le\n",r);
		if(y < 0) {
			if(fabs(y)<TINYLENGTH) y=0;
			else {
				//printf("\nget_bfield: particle is going backward\n");
				//printf("x=%le,y=%le\n",x,y);
				return LOST_BACK;
			}
		}
		if(y >= cell->boun.ymax) {
			if(y >= 1.5*cell->boun.ymax) {
				//printf("get_bfield: ask field at a point very far out the boundaries (y > 1.5*cell->boun.ymax)\n");
				return LOST_L;
				//errorstop("!!! Error in get_bfield: ask field at a point very far out the boundaries (y > 1.5*cell->boun.ymax), you are doing something wrong!!! (Possible solution: if you are using adaptative step-size, consider to decrease STPSZ_MAXFAC, see constant.h)");
			}
			else {
				if(doyou_long_boun_sym == YES) y = 2*cell->boun.ymax - y;
				else {
					*bx=0; *by=0; *bz=0; return ALIVE;
				}
			}
			//but if we just need the field right after the boundary, for the last tracking step:
			//we assume that this boundary is a symmetry plane in the field distribution (zero field could for instance be assume, in this case replace the lines below by: *bx = *by = *bz = 0; return ALIVE;...)
		}
	}
	
	
	*bx = 0.;
	*by = 0.;
	*bz = 0.;
	//collimators (in Cell local framework)
	if(r < cell->collim.rmin) {
		//printf("\nget_bfield: particle hits Horizontal aperture,  r = %le < rmin = %le [m]\n", r, cell->collim.rmin);
		return LOST_H_MIN;
	}
	if(r > cell->collim.rmax) {
		//printf("\nget_bfield: particle hits Horizontal aperture,  r = %le > rmax = %le [m]\n", r, cell->collim.rmax);
		return LOST_H_MAX;
	}
	if(z < cell->collim.zmin) {
		//printf("\nget_bfield: particle hits Vertical aperture, z = %le < zmin = %le [m]\n", z, cell->collim.zmin);
		return LOST_V_MIN;
	}
	if(z > cell->collim.zmax) {
		//printf("\nget_bfield: particle hits Vertical aperture, z = %le > zmax = %le [m]\n", z, cell->collim.zmax);
		return LOST_V_MAX;
	}	
	//printf("passed collimators\n");
	//add comtribution of each component to get the field at (x,y,z)
	//sum the contribution of each component in the cell
	for(i = 0; i < cell->nbcomp; i++) {
		//if(write_enge==YES) printf("pole %i of %i, %le, %le, %le\n", i, cell->nbcomp, x,y,z);
		//add the contribution component number i, taking into account alignment errors
		if(cell->doyou_err == YES) {
			apply_alierror_comp(cell, i, x, y, z, &xwerr, &ywerr, &zwerr);
			(*add_contribution_comp)(xwerr, ywerr, zwerr, bx, by, bz, cell, i);
		}
		else {
			(*add_contribution_comp)(x, y, z, bx, by, bz, cell, i); //else, add the contribution component number i
			//printf("%i: B(%le,%le,%le)\n", i, *bx,*by,*bz);
		}
	}
	return ALIVE;
}

