								//if(isfinite(d11brdz11)!=0) br  += z11/39916800.*d11brdz11;
								//if(isfinite(d11btdz11)!=0) bth += z11/39916800.*d11btdz11;
								//if(isfinite(d12bzdz12)!=0) bz_temp += z12/479001600.*d12bzdz12;
								if(sanity_test_number(d11brdz11)==TRUE) br  += z11/39916800.*d11brdz11;
