extern void add_field_comp_FFAGstraight_he (double x, double y, double z, double *bx, double *by, double *bz, struct Cell *cell, int ic)
{
	double ffbe, ffbs, x0, bz0, kovero, bz_peak;
	
	(void)z;
	(void)bx;
	(void)by;
	
	//use component parameters
	ffbe = cell->mpara[ic][0] + cell->efben[ic][0];
	ffbs = cell->mpara[ic][0] + cell->efbex[ic][0];
	x0 = cell->mpara[ic][1];
	bz0 = cell->mpara[ic][2];
	kovero = cell->mpara[ic][3];
	bz_peak = bz0*exp(kovero*(x - x0));
	
	if(y >= ffbe && y <= ffbs) {
		//if(inside_he_mag_boun==NO) *by += z*bz_peak;
		*bx += z*bz_peak*kovero;
		*bz += bz_peak;
		//inside_he_mag_boun = YES;
	}
	//else {
	//	if(inside_he_mag_boun==YES) {
	//		*bx += z*bz_peak*kovero;
	//		*by += -z*bz_peak;
	//	}
	//	inside_he_mag_boun = NO;
	//}
}

extern void add_field_comp_FFAGstraight_lin(double x, double y, double z, double *bx, double *by, double *bz, struct Cell *cell, int ic)
{
	double bz_peak, bz_local, ffbe, ffbs, x0, bz0, kovero, lambda_e, lambda_s;
	
	//use component parameters
	ffbe = cell->mpara[ic][0] + cell->efben[ic][0];
	ffbs = cell->mpara[ic][0] + cell->efbex[ic][0];
	x0 = cell->mpara[ic][1];
	bz0 = cell->mpara[ic][2];
	kovero = cell->mpara[ic][3];
	lambda_e = cell->efben[ic][1];
	lambda_s = cell->efbex[ic][1];
	
	bz_peak = bz0*exp(kovero*(x - x0));
	
	if(ffbs - ffbe < lambda_e + lambda_s) printf("!Warning in add_field_comp_FFAGstraight_lin: magnet length < lambda_e + lambda_s !\n");
	
	if(lambda_e != 0 && y >= ffbe - lambda_e && y < ffbe + lambda_e) {
		bz_local = bz_peak*((y - ffbe + lambda_e)/(2.*lambda_e));
		*bx += z*bz_local*kovero;
		*by += z*bz_peak/(2.*lambda_e);
		*bz += bz_local;
	}
	else if(y >= ffbe + lambda_e && y <= ffbs - lambda_s) {
		bz_local = bz_peak;
		*bx += z*bz_local*kovero;
		*by += 0;
		*bz += bz_local;
	}
	else if(lambda_s != 0 && y > ffbs - lambda_s && y <= ffbs + lambda_s) {
		bz_local = bz_peak*(1 - (y - ffbs + lambda_s)/(2.*lambda_s));
		*bx += z*bz_local*kovero;
		*by += -z*bz_peak/(2.*lambda_s);
		*bz += bz_local;
	}
}

extern void add_field_comp_FFAGstraight_purescale(double x, double y, double z, double *bx, double *by, double *bz, struct Cell *cell, int ic)
{
	double ffbe, ffbs, x0, bz0, kovero, lambda_e, c1e, lambda_s, c1s, ae, as,
		ee, es, u, dudy, d2udy2, d3udy3, d4udy4, f, dfdy, d2fdy2, d3fdy3, d4fdy4,		
		b, dbdx, d2bdx2, d3bdx3, d4bdx4,
		dbzdx, d2bzdx2, d3bzdx3, d4bzdx4, dbzdy, d2bzdy2, d3bzdy3, d4bzdy4,
		dbxdz, dbydz, d2bzdz2, d3bxdz3, d3bydz3, d4bzdz4;
	
	if(cell->efben[ic][2] != 0 || cell->efbex[ic][2] != 0) errorstop("!!!ERROR in add_field_comp_FFAGstraight_purescale, kappa != 0, this case has not yet been implemented!!!");
	
	//use component parameters
	ffbe = cell->mpara[ic][0] + cell->efben[ic][0];
	ffbs = cell->mpara[ic][0] + cell->efbex[ic][0];
	x0 = cell->mpara[ic][1];
	bz0 = cell->mpara[ic][2];
	kovero = cell->mpara[ic][3];
	lambda_e = cell->efben[ic][1];
	c1e = cell->efben[ic][3];		//enge coeff. c1 entrance face
	lambda_s = cell->efbex[ic][1];
	c1s = cell->efbex[ic][3];		//enge coeff. c1 exit face
	
	
	//+//compute bx, by, bz
	ae = c1e/lambda_e;
	as = c1s/lambda_s;
	
	//in case you are very far from the magnet, avoid ee and es to averflow the largest double. In this case you will add nothing to *bx, *by and *bz (because you are very far both effective field boundaries)
	if(ae*(ffbe - y) < NOOVFLOW_ENGE && as*(y - ffbs) < NOOVFLOW_ENGE) { 
		ee = exp(ae*(ffbe - y));
		es = exp(as*(y - ffbs));
		u = (1 + es)*(1 + ee);
		dudy = as*es*(1 + ee) - ae*ee*(1 + es);
		d2udy2 = pow(as, 2)*es*(1 + ee) - 2*as*ae*es*ee + pow(ae, 2)*ee*(1 + es);
		d3udy3 = pow(as, 3)*es*(1 + ee) - ee*es*(3*pow(as, 2)*ae - 3*as*pow(ae, 2)) - pow(ae, 3)*ee*(1 + es);
		d4udy4 = pow(as, 4)*es*(1 + ee) - ee*es*(4*pow(as, 3)*ae - 6*pow(as, 2)*pow(ae, 2) + 4*as*pow(ae, 3)) + pow(ae, 4)*ee*(1 + es);	
	
		b = bz0*exp(kovero*(x-x0));
		dbdx = b*kovero;
		d2bdx2 = dbdx*kovero;
		d3bdx3 = d2bdx2*kovero;
		d4bdx4 = d3bdx3*kovero;
		
		f = 1/u; //flutter
		dfdy = -dudy/(u*u); //dflutter/dy
		d2fdy2 = (2*dudy*dudy - u*d2udy2)/(u*u*u); //d2flutter/dy2
		d3fdy3 = (6*u*dudy*d2udy2 - u*u*d3udy3 - 6*dudy*dudy*dudy)/(u*u*u*u); //d3flutter/dy3
		//d4fdy4 = (u*(6*u*d2udy2*d2udy2 - u*u*d4udy4 + 4*u*dudy*d3udy3 - 12*dudy*dudy*d2udy2) - 4*dudy*(6*u*dudy*d2udy2 - u*u*d3udy3 - 6*dudy*dudy*dudy))/(u*u*u*u*u); //d4 flutter/dy4
		d4fdy4 = (6*u*u*d2udy2*d2udy2 - 36*u*dudy*dudy*d2udy2 - u*u*u*d4udy4 + 24*dudy*dudy*dudy*dudy + 8*u*u*dudy*d3udy3)/(u*u*u*u*u); //d4 flutter/dy4
	
		//derivatives of the mid-plane Bz field /dx and /dy
		dbzdx	= f*dbdx;
		d2bzdx2 = f*d2bdx2;
		d3bzdx3 = f*d3bdx3;
		d4bzdx4 = f*d4bdx4;
		dbzdy	= b*dfdy;
		d2bzdy2 = b*d2fdy2;
		d3bzdy3 = b*d3fdy3;
		d4bzdy4 = b*d4fdy4;
	
		//derivatives /dz used to get the coeff. of the Taylor expansion
		dbxdz	= dbzdx;
		dbydz	= dbzdy;
		d2bzdz2 = - d2bzdx2 - d2bzdy2;
		d3bxdz3 = - d3bzdx3 - dbdx*d2fdy2;
		d3bydz3 = - d3bzdy3 - d2bdx2*dfdy;
		d4bzdz4 = d4bzdx4 + 2*d2bdx2*d2fdy2 + d4bzdy4;
	
		*bx += z*dbxdz + z*z*z/6*d3bxdz3;
		*by += z*dbydz + z*z*z/6*d3bydz3;
		*bz += f*b + z*z/2.*d2bzdz2 + z*z*z*z/24*d4bzdz4;
	}
}



extern void add_field_comp_FFAGstraighttilt_he (double x, double y, double z, double *bx, double *by, double *bz, struct Cell *cell, int ic)
{
	double ffbe, ffbs, x0, bz0, kovero, zeta, y0;
	
	(void)z;
	(void)bx;
	(void)by;
	//use component parameters
	ffbe = cell->mpara[ic][0] + cell->efben[ic][0];
	ffbs = cell->mpara[ic][0] + cell->efbex[ic][0];
	x0 = cell->mpara[ic][1];
	bz0 = cell->mpara[ic][2];
	kovero = cell->mpara[ic][3];
	zeta = cell->mpara[ic][4];
	
	y0 = y-tan(zeta)*(x-x0);
	
	if(y0 >= ffbe && y0 <= ffbs) *bz += bz0*exp(kovero*(x - x0));
}

