extern void add_field_comp_VFFA_rect_he(double x, double y, double z, double *bx, double *by, double *bz, struct Cell *cell, int ic)
{
	int order;
	double x0,y0,z0,bz0,m,angle,conv_lim,ffbe,ffbs,newx,newy;
	double bxtemp=0,bztemp=0;
	
	//alpha0 r0 bz0 z0 m alpha1
	x0 = cell->mpara[ic][1]*cos(cell->mpara[ic][0]);
	y0 = cell->mpara[ic][1]*sin(cell->mpara[ic][0]);
	z0 = cell->mpara[ic][3];
	bz0 = cell->mpara[ic][2];
	m = cell->mpara[ic][4];
	angle = cell->mpara[ic][5];
	conv_lim = cell->mpara[ic][6]; //convergence limit [m]
	if(conv_lim<TINYLENGTH) errorstop("convergence limit <=0, have you initialized it?");
	ffbe = cell->efben[ic][0];
	ffbs = cell->efbex[ic][0];
	order = (int)(cell->efben[ic][2]); //interpolation off the mid-plane up to this order
	//printf("x0,y0,z0=(%lf,%lf,%lf), bz0=%lf, m=%lf, angle=%le, conv_lim=%lf, ffbe=%lf, ffbs=%lf, order=%i\n", x0,y0,z0,bz0,m,angle, conv_lim,ffbe,ffbs, order);
	newx = (y-y0)*sin(cell->mpara[ic][0]+angle)+(x-x0)*cos(cell->mpara[ic][0]+angle);
	newy = (y-y0)*cos(cell->mpara[ic][0]+angle)-(x-x0)*sin(cell->mpara[ic][0]+angle);
	//printf("newx=%le, newy=%le\n", newx, newy);
	if(newy>ffbe && newy<ffbs && fabs(newx)<conv_lim) {
		comp_field_vffa_rect_he(newx, z, &bxtemp, &bztemp, order, bz0, m, z0);
	}
	*bx += bxtemp*cos(cell->mpara[ic][0]+angle);
	*by += bxtemp*sin(cell->mpara[ic][0]+angle);
	*bz += bztemp;
}

