// linear fringe field with extrapolation off mid-plane up to n-th order
extern void add_field_comp_VFFA_rect_lin(double x, double y, double z, double *bx, double *by, double *bz, struct Cell *cell, int ic)
{
	int order;
	double x0,y0,z0,bz0,m,angle,conv_lim,ffbe,ffbs,lambda_e,lambda_s,newx,newy;
	double bxtemp=0,bytemp=0,bztemp=0;
	
	//alpha0 r0 bz0 z0 m alpha1
	x0 = cell->mpara[ic][1]*cos(cell->mpara[ic][0]);
	y0 = cell->mpara[ic][1]*sin(cell->mpara[ic][0]);
	z0 = cell->mpara[ic][3];
	bz0 = cell->mpara[ic][2];
	m = cell->mpara[ic][4];
	angle = cell->mpara[ic][5];
	conv_lim = cell->mpara[ic][6]; //convergence limit [m]
	if(conv_lim<TINYLENGTH) errorstop("convergence limit <=0, have you initialized it?");
	ffbe = cell->efben[ic][0];
	ffbs = cell->efbex[ic][0];
	lambda_e = cell->efben[ic][1];
	lambda_s = cell->efbex[ic][1];
	if(ffbs - ffbe < lambda_e + lambda_s) printf("!Warning in add_field_comp_VFFA_rect_lin: magnet length < lambda_e + lambda_s !\n");
	order = (int)(cell->efben[ic][2]); //interpolation off the mid-plane up to this order
	
	newx = (y-y0)*sin(cell->mpara[ic][0]+angle)+(x-x0)*cos(cell->mpara[ic][0]+angle);
	newy = (y-y0)*cos(cell->mpara[ic][0]+angle)-(x-x0)*sin(cell->mpara[ic][0]+angle);
	
	if(fabs(newx)<conv_lim) {
		if(lambda_e != 0 && newy >= ffbe - lambda_e && newy < ffbe + lambda_e) { //entrance fringe field
			double f0, fp0;
			f0=(newy - ffbe + lambda_e)/(2.*lambda_e);
			fp0=1./(2.*lambda_e);
			comp_field_vffa_rect_lin(newx, z, &bxtemp, &bytemp, &bztemp, order, bz0, m, z0, f0, fp0);
		}
		else if(newy >= ffbe + lambda_e && newy <= ffbs - lambda_s) { // main body
			comp_field_vffa_rect_lin(newx, z, &bxtemp, &bytemp, &bztemp, order, bz0, m, z0, 1., 0.);
			//comp_field_vffa_rect_he(newx, z, &bxtemp, &bztemp, order, bz0, m, z0);
			//bytemp=0;
		}
		else if(lambda_s != 0 && newy > ffbs - lambda_s && newy <= ffbs + lambda_s) { //exit fringe field
			double f0, fp0;
			f0=1 - (newy - ffbs + lambda_s)/(2.*lambda_s);
			fp0=-1./(2.*lambda_s);
			comp_field_vffa_rect_lin(newx, z, &bxtemp, &bytemp, &bztemp, order, bz0, m, z0, f0, fp0);
		}
	}
	*bx += bxtemp*cos(cell->mpara[ic][0]+angle)-bytemp*sin(cell->mpara[ic][0]+angle);
	*by += bxtemp*sin(cell->mpara[ic][0]+angle)+bytemp*cos(cell->mpara[ic][0]+angle);
	*bz += bztemp;
}

