extern void add_field_comp_VFFA_rect_enge(double x, double y, double z, double *bx, double *by, double *bz, struct Cell *cell, int ic)
{
	int order, conv_lim_flag, test_conv_lim=NO;
	double x_0,y_0,z_0,bz0,m,conv_lim,angle,ffbe,ffbs,lambda_e,lambda_s,newx,newy, ae,as,c1e,c1s,bxtemp=0,bytemp=0,bztemp=0;
	FILE *wfile;
	
	if(write_enge==YES) wfile = fopen("data/field_vffa_loc.dat", "a");
	
	x_0 = cell->mpara[ic][1]*cos(cell->mpara[ic][0]);
	y_0 = cell->mpara[ic][1]*sin(cell->mpara[ic][0]);
	z_0 = cell->mpara[ic][3];
	bz0 = cell->mpara[ic][2];
	m = cell->mpara[ic][4];
	conv_lim = cell->mpara[ic][6]; //convergence limit [m]
	if(conv_lim<TINYLENGTH) errorstop("convergence limit <=0, have you initialized it?");
	angle = cell->mpara[ic][0]+cell->mpara[ic][5];
	newx = (y-y_0)*sin(angle) + (x-x_0)*cos(angle);
	newy = (y-y_0)*cos(angle) - (x-x_0)*sin(angle);
	//printf("new=(%.8e,%.8e)\n",newx,newy);
	ffbe = cell->efben[ic][0];
	ffbs = cell->efbex[ic][0];
	lambda_e = cell->efben[ic][1];
	c1e = cell->efben[ic][3];		//enge coeff. c1 entrance face
	lambda_s = cell->efbex[ic][1];
	c1s = cell->efbex[ic][3];		//enge coeff. c1 exit face
	order = (int)(cell->efben[ic][2]); //interpolation off the mid-plane up to this order
	//printf("order=%i\n", order);
	if(order<0) errorstop("!!!ERROR in add_field_comp_VFFA_rect_enge order<0");
	//printf("(x,y,z)=(%.8e,%.8e,%.8e), new=(%.8e,%.8e)\n",x,y,z,newx,newy);
	//printf("conv_lim=%le, ov_flow_en=%le, ov_flow_ex=%le\n", conv_lim, ae*(ffbe - newy), as*(newy - ffbs));
	
	//compute bx, by, bz
	ae = c1e/lambda_e;
	as = c1s/lambda_s;
	
	if(test_conv_lim==YES) {
		double bx2,by2,bz2,bx10,by10,bz10;
		comp_field_vffa_rect_enge_polynom(newx, newy, z, &bx2, &by2, &bz2, 2, bz0, m, ffbe, ffbs, ae, as, z_0);
		comp_field_vffa_rect_enge_polynom(newx, newy, z, &bx10, &by10, &bz10, 10, bz0, m, ffbe, ffbs, ae, as, z_0);
		if(fabs(bx10-bx2)>fabs(bx2) || fabs(by10-by2)>fabs(by2) || fabs(bz10-bz2)>fabs(bz2)) conv_lim_flag = NO;
		else conv_lim_flag = YES;
		
	}
	else if(fabs(newx)<conv_lim) conv_lim_flag = YES;
	else conv_lim_flag = NO;
	if(ae*(ffbe - newy) < NOOVFLOW_ENGE && as*(newy - ffbs) < NOOVFLOW_ENGE && conv_lim_flag==YES && order>0) {
		comp_field_vffa_rect_enge_polynom(newx, newy, z, &bxtemp, &bytemp, &bztemp, order, bz0, m, ffbe, ffbs, ae, as, z_0);
	}
	//printf("mag fmwk %le	%le	%le\n", bxtemp,bytemp,bztemp);
	if(write_enge==YES) {
		double x_g, y_g;
		x_g = x; y_g = y; fwk_pt_loctoglob(&x_g, &y_g, &(cell->framework));
		//printf("pole %i, (x,y,z)=(%le,%le,%le),\nB (%le, %le, %le)\n", ic, x_g,y_g,z,bxtemp,bytemp,bztemp);
		fprintf(wfile, "%le	%le	%le	%le	%le	%le\n", x_g,y_g,z,bxtemp,bytemp,bztemp);
		fclose(wfile);
	}
	*bx += bxtemp*cos(angle) - bytemp*sin(angle);
	*by += bxtemp*sin(angle) + bytemp*cos(angle);
	*bz += bztemp;
}

