extern void add_field_comp_VFFA_sect_lin(double x, double y, double z, double *bx, double *by, double *bz, struct Cell *cell, int ic)
{
	int sign_rho;
	double xm, ym, r, th, thc, ffbe, ffbs, rc, z0, bz0, m, rho, thfringe_e, thfringe_s, br, bth, bz_peak, bz_local, bxm, bym, bzm,a,b,c;
	
	//use component parameters
	thc = cell->mpara[ic][0]; //[rad]
	ffbe = cell->efben[ic][0]; //[rad]
	ffbs = cell->efbex[ic][0]; //[rad]
	rc = cell->mpara[ic][1];
	bz0 = cell->mpara[ic][2];
	z0 = cell->mpara[ic][3];
	m = cell->mpara[ic][4];
	sign_rho = sign(cell->mpara[ic][5]);
	rho = cell->mpara[ic][5];
	thfringe_e = cell->efben[ic][1]; //[rad]
	thfringe_s = cell->efbex[ic][1]; //[rad]
	
	xm = sign_rho*(x*cos(thc) + y*sin(thc)-rc+rho);
	ym = -x*sin(thc) + y*cos(thc);
	
	//convert cartesian local magnet framework coordinates into cylindrical
	if(xm!=0) th = atan2(ym,xm);
	else {
		if(ym<0) th = -PI/2.;
		else if(ym>0) th = PI/2.;
		else th = 0;
	}
	r = sqrt(xm*xm + ym*ym);
	
	//printf("(x,y,z)=(%le, %le, %le)\n",x,y,z);
	//printf("(xm,ym)=(%le, %le)\n",xm,ym);
	//printf("(rho,th)=(%le, %le)\n",r,th*180/PI);
	
	c = y1(m*rho)*j0(m*rho)-j1(m*rho)*y0(m*rho);
	a = y1(m*rho)/c;
	b = j1(m*rho)/c;
	bz_peak = bz0*exp(m*(z-z0));
	br = 0;
	bth = 0;
	bz_local = 0;
	
	if(ffbs - ffbe < thfringe_e + thfringe_s) printf("!Warning in add_field_comp_VFFA_sect_lin: magnet length < thfringe_e + thfringe_s !\n");
	
	//compute br, bth, bz
	if(thfringe_e != 0 && th >= ffbe - thfringe_e && th < ffbe + thfringe_e) {
		//printf("inside 1\n");
		bz_local = bz_peak*(a*j0(m*r) - b*y0(m*r))*((th - ffbe + thfringe_e)/(2.*thfringe_e));
		br = bz_peak*(-a*j1(m*r) + b*y1(m*r))*((th - ffbe + thfringe_e)/(2.*thfringe_e));
		bth = bz_peak*(a*j0(m*r) - b*y0(m*r))/(2.*thfringe_e);
	}
	else if(th >= ffbe + thfringe_e && th <= ffbs - thfringe_s) {
		//printf("inside 2\n");
		bz_local = bz_peak*(a*j0(m*r) - b*y0(m*r));
		br = bz_peak*(-a*j1(m*r) + b*y1(m*r));
		bth = 0;
	}
	else if(thfringe_s != 0 && th > ffbs - thfringe_s && th <= ffbs + thfringe_s) {
		//printf("inside 3\n");
		bz_local = bz_peak*(a*j0(m*r) - b*y0(m*r))*(1 - (th - ffbs + thfringe_s)/(2.*thfringe_s));
		br = bz_peak*(-a*j1(m*r) + b*y1(m*r))*(1 - (th - ffbs + thfringe_s)/(2.*thfringe_s));
		bth = -bz_peak*(a*j0(m*r) - b*y0(m*r))/(2.*thfringe_s*m*r);
	}
	bxm = sign_rho*(br*cos(th) - bth*sin(th));
	bym = br*sin(th) + bth*cos(th);
	bzm = sign_rho*bz_local;
	
	//add contribution of this component onto the bfield in the Cell (componants of b field in the local cartesian framework)
	*bx += bxm*cos(thc)-bym*sin(thc);
	*by += bxm*sin(thc)+bym*cos(thc);
	*bz += bzm;
	//printf("br=%lf,bth=%lf,bz_local=%lf\n", br,bth,bz_local);
	//printf("bxm=%lf,bym=%lf,bzm=%lf\n", bxm,bym,bzm);
	//printf("bx=%lf,by=%lf,bz=%lf\n", *bx,*by,*bz);
}

extern void add_field_comp_VFFA_sect_enge(double x, double y, double z, double *bx, double *by, double *bz, struct Cell *cell, int ic)
{
	int sign_rho, order, conv_lim_flag, test_conv_lim=NO;
	double thc, rc, bz0, z_0, m, rho, conv_lim, ffbe, ffbs, rlce, rlcs, xm, ym, zm, r, th;
	
	//use component parameters
	thc = cell->mpara[ic][0]; //[rad]
	rc = cell->mpara[ic][1];
	bz0 = cell->mpara[ic][2];
	z_0 = cell->mpara[ic][3];
	m = cell->mpara[ic][4];
	sign_rho = sign(cell->mpara[ic][5]);
	rho = (cell->mpara[ic][5]);
	conv_lim = cell->mpara[ic][6]; //convergence limit [m]
	if(conv_lim<TINYLENGTH) errorstop("convergence limit <=0, have you initialized it?");
	ffbe = cell->efben[ic][0]; //[rad]
	ffbs = cell->efbex[ic][0]; //[rad]
	rlce = cell->efben[ic][3]*fabs(rho)/cell->efben[ic][1]; // r0/lambda0*c1[enge coeff] entrance face
	rlcs = cell->efbex[ic][3]*fabs(rho)/cell->efbex[ic][1]; //r0/lambda0*c1[enge coeff] exit face
	order = (int)(cell->efben[ic][2]); //interpolation off the mid-plane up to this order
	if(order<0) errorstop("!!!ERROR in add_field_comp_VFFA_sect_enge order<0");
	
	//convert cell framework to local magnet framework
	xm = sign_rho*(x*cos(thc) + y*sin(thc)-rc+rho);
	ym = -x*sin(thc) + y*cos(thc);
	zm = sign_rho*z;
	//convert cartesian local magnet framework coordinates into cylindrical local magnet framework
	if(xm!=0) th = atan2(ym,xm);
	else th = sign(ym)*PI/2.;
	r = sqrt(xm*xm + ym*ym);
	//printf("(x,y,z)=(%le, %le, %le)\n",x,y,z);
	//printf("(xm,ym)=(%le, %le)\n",xm,ym);
	//printf("(rho,th)=(%le, %le)\n",r,th*180/PI);
	
	if(test_conv_lim==YES) {
		double br2,bth2,bz2,br10,bth10,bz10;
		comp_field_vffa_sect_enge_polynom(r, th, zm, &br2, &bth2, &bz2, 2, bz0, m, ffbe, ffbs, rlce, rlcs, fabs(rho), z_0);
		comp_field_vffa_sect_enge_polynom(r, th, zm, &br10, &bth10, &bz10, 10, bz0, m, ffbe, ffbs, rlce, rlcs, fabs(rho), z_0);
		if(fabs(br10-br2)>fabs(br2) || fabs(bth10-bth2)>fabs(bth2) || fabs(bz10-bz2)>fabs(bz2)) conv_lim_flag = NO;
		else conv_lim_flag = YES;
	}
	else if(fabs(r-fabs(rho))<conv_lim) conv_lim_flag = YES;
	else conv_lim_flag = NO;
	if(rlce*(ffbe - th) < NOOVFLOW_ENGE && rlcs*(th - ffbs) < NOOVFLOW_ENGE && conv_lim_flag==YES && order>0) {
		double br, bth, bxm, bym, bzm;
		
		comp_field_vffa_sect_enge_polynom(r, th, zm, &br, &bth, &bzm, order, bz0, m, ffbe, ffbs, rlce, rlcs, fabs(rho), z_0);
		bxm = sign_rho*(br*cos(th) - bth*sin(th));
		bym = br*sin(th) + bth*cos(th);
		//add contribution of this component onto the bfield in the Cell (componants of b field in the local cartesian framework)
		*bx += bxm*cos(thc)-bym*sin(thc);
		*by += bxm*sin(thc)+bym*cos(thc);
		*bz += sign_rho*bzm;
		//printf("br=%lf,bth=%lf,bz_local=%lf\n", br,bth,bz_local);
		//printf("bxm=%lf,bym=%lf,bzm=%lf\n", bxm,bym,bzm);
		//printf("bx=%lf,by=%lf,bz=%lf\n", *bx,*by,*bz);
	}
}

extern void add_field_comp_VFFA_rect_atan(double x, double y, double z, double *bx, double *by, double *bz, struct Cell *cell, int ic)
{
	int order, conv_lim_flag;//, test_conv_lim=NO;
	double x_0,y_0,z_0,bz0,m,conv_lim,angle,ffbe,ffbs,lambda_e,newx,newy,bxtemp=0,bytemp=0,bztemp=0;
	FILE *wfile;
	
	if(write_enge==YES) wfile = fopen("data/field_vffa_loc.dat", "a");
	
	x_0 = cell->mpara[ic][1]*cos(cell->mpara[ic][0]);//(=rmagnet*cos(thmagnet))
	y_0 = cell->mpara[ic][1]*sin(cell->mpara[ic][0]);
	z_0 = cell->mpara[ic][3];
	bz0 = cell->mpara[ic][2];
	m = cell->mpara[ic][4];
	conv_lim = cell->mpara[ic][6]; //convergence limit [m]
	if(conv_lim<TINYLENGTH) errorstop("convergence limit <=0, have you initialized it?");
	angle = cell->mpara[ic][0]+cell->mpara[ic][5];
	newx = (y-y_0)*sin(angle) + (x-x_0)*cos(angle);
	newy = (y-y_0)*cos(angle) - (x-x_0)*sin(angle);
	//printf("new=(%.8e,%.8e)\n",newx,newy);
	ffbe = cell->efben[ic][0];
	ffbs = cell->efbex[ic][0];
	lambda_e = cell->efben[ic][1];
	//c1e = cell->efben[ic][3];		//enge coeff. c1 entrance face
	//lambda_s = cell->efbex[ic][1];
	//c1s = cell->efbex[ic][3];		//enge coeff. c1 exit face
	order = (int)(cell->efben[ic][2]); //interpolation off the mid-plane up to this order
	//printf("order=%i\n", order);
	if(order<0) errorstop("!!!ERROR in add_field_comp_VFFA_rect_enge order<0");
	//printf("(x,y,z)=(%.8e,%.8e,%.8e), new=(%.8e,%.8e)\n",x,y,z,newx,newy);
	
	//compute bx, by, bz
	//ae = c1e/lambda_e;
	//as = c1s/lambda_s;
	
	//if(test_conv_lim==YES) {
	//	double bx2,by2,bz2,bx10,by10,bz10;
	//	comp_field_vffa_rect_atan_add(newx, newy, z, &bx2, &by2, &bz2, 2, bz0, m, ffbe, ffbs, lambda_e, z_0);
	//	comp_field_vffa_rect_atan_add(newx, newy, z, &bx10, &by10, &bz10, 10, bz0, m, ffbe, ffbs, lambda_e, z_0);
	//	if(fabs(bx10-bx2)>fabs(bx2) || fabs(by10-by2)>fabs(by2) || fabs(bz10-bz2)>fabs(bz2)) conv_lim_flag = NO;
	//	else conv_lim_flag = YES;
	//}
	//else 
	if(fabs(newx)<conv_lim) conv_lim_flag = YES;
	else conv_lim_flag = NO;
	//printf("order=%i, conv_lim=%le, conv_lim_flag=%i, yes=%i, no=%i\n", order, conv_lim, conv_lim_flag, YES, NO);
	
	if(conv_lim_flag==YES && order>0) {
		comp_field_vffa_rect_atan_add(newx, newy, z, &bxtemp, &bytemp, &bztemp, order, bz0, m, ffbe, ffbs, lambda_e, z_0);
	}
	else {
		//printf("conv_lim_flag=NO!\n");
	}
	if(write_enge==YES) {
		double x_g, y_g;
		x_g = x; y_g = y; fwk_pt_loctoglob(&x_g, &y_g, &(cell->framework));
		//printf("pole %i, (x,y,z)=(%le,%le,%le),\nB (%le, %le, %le)\n", ic, x_g,y_g,z,bxtemp,bytemp,bztemp);
		fprintf(wfile, "%le	%le	%le	%le	%le	%le	%le	%le\n", x_g,y_g,z,newx,newy,bxtemp,bytemp,bztemp);
		fclose(wfile);
	}
	*bx += bxtemp*cos(angle) - bytemp*sin(angle);
	*by += bxtemp*sin(angle) + bytemp*cos(angle);
	*bz += bztemp;
}

