extern void add_field_comp_realbend(double x, double y, double z, double *bx, double *by, double *bz, struct Cell *cell, int ic)
{
	double ffbe, ffbs, x0, y0, xm, xp, lambda_t, c1t, bz0, lambda_e, c1e, lambda_s, c1s, newx, newy, ae, as, at,
	ee, es, em, ep, u, dudy, d2udy2, d3udy3, d4udy4, f, dfdy, d2fdy2, d3fdy3, d4fdy4,
	v, dvdx, d2vdx2, d3vdx3, d4vdx4, g,
	b, dbdx, d2bdx2, d3bdx3, d4bdx4,
	dbzdx, d2bzdx2, d3bzdx3, d4bzdx4, dbzdy, d2bzdy2, d3bzdy3, d4bzdy4,
	dbxdz, dbydz, d2bzdz2, d3bxdz3, d3bydz3, d4bzdz4;
	
	if(cell->efben[ic][2] != 0 || cell->efbex[ic][2] != 0) errorstop("!!!ERROR in add_field_comp_realbend, kappa != 0, this case has not yet been implemented!!!");
	if(ic!=0) errorstop("error in add_field_comp_realbend, cell number is not 0");
	//use component parameters
	
	x0 = cell->mpara[ic][0]*cos(cell->boun.thmax/2.);
	y0 = cell->mpara[ic][0]*sin(cell->boun.thmax/2.);
	ffbe = y0 + cell->efben[ic][0];
	ffbs = y0 + cell->efbex[ic][0];
	xm = x0 - cell->mpara[ic][1];
	xp = x0 + cell->mpara[ic][1];
	lambda_t = cell->mpara[ic][2];
	c1t = cell->mpara[ic][3];
	bz0 = cell->mpara[ic][4];
	
	lambda_e = cell->efben[ic][1];
	c1e = cell->efben[ic][3];		//enge coeff. c1 entrance face
	lambda_s = cell->efbex[ic][1];
	c1s = cell->efbex[ic][3];		//enge coeff. c1 exit face
	
	newx = x0+(x-x0)*cos(cell->boun.thmax/2.)+(y-y0)*sin(cell->boun.thmax/2.);
	newy = y0-(x-x0)*sin(cell->boun.thmax/2.)+(y-y0)*cos(cell->boun.thmax/2.);
	
	//+//compute bx, by, bz
	ae = c1e/lambda_e;
	as = c1s/lambda_s;
	at = c1t/lambda_t;
	
	//in case you are very far from the magnet, avoid ee and es to averflow the largest double. In this case you will add nothing to *bx, *by and *bz (because you are very far both effective field boundaries)
	if(ae*(ffbe - newy) < NOOVFLOW_ENGE && as*(newy - ffbs) < NOOVFLOW_ENGE  && at*(xm - newx) < NOOVFLOW_ENGE && at*(newx - xp) < NOOVFLOW_ENGE) { 
		ee = exp(ae*(ffbe - newy));
		es = exp(as*(newy - ffbs));
		u = (1 + es)*(1 + ee);
		dudy = as*es*(1 + ee) - ae*ee*(1 + es);
		d2udy2 = pow(as, 2)*es*(1 + ee) - 2*as*ae*es*ee + pow(ae, 2)*ee*(1 + es);
		d3udy3 = pow(as, 3)*es*(1 + ee) - ee*es*(3*pow(as, 2)*ae - 3*as*pow(ae, 2)) - pow(ae, 3)*ee*(1 + es);
		d4udy4 = pow(as, 4)*es*(1 + ee) - ee*es*(4*pow(as, 3)*ae - 6*pow(as, 2)*pow(ae, 2) + 4*as*pow(ae, 3)) + pow(ae, 4)*ee*(1 + es);	
		
		em = exp(at*(xm - newx));
		ep = exp(at*(newx - xp));
		v = (1 + em)*(1 + ep);
		dvdx = at*ep*(1 + em) - at*em*(1 + ep);
		d2vdx2 = pow(at, 2)*ep*(1 + em) - 2*at*at*ep*em + pow(at, 2)*em*(1 + ep);
		d3vdx3 = pow(at, 3)*ep*(1 + em) - em*ep*(3*pow(at, 2)*at - 3*at*pow(at, 2)) - pow(at, 3)*em*(1 + ep);
		d4vdx4 = pow(at, 4)*ep*(1 + em) - em*ep*(4*pow(at, 3)*at - 6*pow(at, 2)*pow(at, 2) + 4*at*pow(at, 3)) + pow(at, 4)*em*(1 + ep);	

		g = 1/v;
		b = bz0*g;
		dbdx = bz0*(-dvdx/(v*v));
		d2bdx2 = bz0*((2*dvdx*dvdx - v*d2vdx2)/(v*v*v));
		d3bdx3 = bz0*((6*v*dvdx*d2vdx2 - v*v*d3vdx3 - 6*dvdx*dvdx*dvdx)/(v*v*v*v));
		d4bdx4 = bz0*((6*v*v*d2vdx2*d2vdx2 - 36*v*dvdx*dvdx*d2vdx2 - v*v*v*d4vdx4 + 24*dvdx*dvdx*dvdx*dvdx + 8*v*v*dvdx*d3vdx3)/(v*v*v*v*v));
		
		f = 1/u; //flutter
		//printf("ee = %lf, es = %lf, u = %lf, f = %lf, g = %lf\n", ee, es, u, f, g);
		dfdy = -dudy/(u*u); //dflutter/dy
		d2fdy2 = (2*dudy*dudy - u*d2udy2)/(u*u*u); //d2flutter/dy2
		d3fdy3 = (6*u*dudy*d2udy2 - u*u*d3udy3 - 6*dudy*dudy*dudy)/(u*u*u*u); //d3flutter/dy3
		//d4fdy4 = (u*(6*u*d2udy2*d2udy2 - u*u*d4udy4 + 4*u*dudy*d3udy3 - 12*dudy*dudy*d2udy2) - 4*dudy*(6*u*dudy*d2udy2 - u*u*d3udy3 - 6*dudy*dudy*dudy))/(u*u*u*u*u); //d4 flutter/dy4
		d4fdy4 = (6*u*u*d2udy2*d2udy2 - 36*u*dudy*dudy*d2udy2 - u*u*u*d4udy4 + 24*dudy*dudy*dudy*dudy + 8*u*u*dudy*d3udy3)/(u*u*u*u*u); //d4 flutter/dy4
		
		//derivatives of the mid-plane Bz field /dx and /dy
		dbzdx	= f*dbdx;
		d2bzdx2 = f*d2bdx2;
		d3bzdx3 = f*d3bdx3;
		d4bzdx4 = f*d4bdx4;
		dbzdy	= b*dfdy;
		d2bzdy2 = b*d2fdy2;
		d3bzdy3 = b*d3fdy3;
		d4bzdy4 = b*d4fdy4;
		
		//derivatives /dz used to get the coeff. of the Taylor expansion
		dbxdz	= dbzdx;
		dbydz	= dbzdy;
		d2bzdz2 = - d2bzdx2 - d2bzdy2;
		d3bxdz3 = - d3bzdx3 - dbdx*d2fdy2;
		d3bydz3 = - d3bzdy3 - d2bdx2*dfdy;
		d4bzdz4 = d4bzdx4 + 2*d2bdx2*d2fdy2 + d4bzdy4;
		
		*bx += z*dbxdz + z*z*z/6*d3bxdz3; //NO!! I have to come back to global coordinates!
		*by += z*dbydz + z*z*z/6*d3bydz3; //NO!! I have to come back to global coordinates!
		*bz += f*b + z*z/2.*d2bzdz2 + z*z*z*z/24*d4bzdz4; //OK
	}
}

extern void add_field_sector_purebend(double x, double y, double z, double *bx, double *by, double *bz, struct Cell *cell, int ic)
{
	
	double r, th, rprime, thprime, ffbe, ffbs, bz0, rc, thc, role, c1e, rols, c1s,
		ee, es, u, dudt, d2udt2, d3udt3, d4udt4, f, dfdt, d2fdt2, d3fdt3, d4fdt4,
		b, dbdr, d2bdr2, d3bdr3, d4bdr4,
		dbzdr, d2bzdr2, d3bzdr3, d4bzdr4, dbzdt, d2bzdt2, d3bzdt3, d4bzdt4,
		dbrdz, dbtdz, d2bzdz2, d3brdz3, d3btdz3, d4bzdz4, br, bth;
		//double r0;
	
	//convert cartesian local framework coordinates into cylindrical
	r = sqrt(x*x + y*y);
	th = atan_ratio(y, x);
	
	if(cell->efben[ic][2] != -1 || cell->efbex[ic][2] != -1) errorstop("!!!ERROR in add_field_sector_purebend, kappa != -1, this case has not yet been implemented!!!");
		
	//use component parameters
	ffbe = cell->mpara[ic][0] + cell->efben[ic][0];
	ffbs = cell->mpara[ic][0] + cell->efbex[ic][0];
	thc = cell->mpara[ic][0];
	//r0 = cell->mpara[ic][1];
	bz0 = cell->mpara[ic][2];
	rc = cell->mpara[ic][3];
	c1e = cell->efben[ic][3];		//enge coeff. c1 entrance face
	c1s = cell->efbex[ic][3];		//enge coeff. c1 exit face
	
	if(r < rc) errorstop("!!!ERROR in add_field_sector_purebend, ask field a r < rc,\n please use collimator with rmin > rc to avoid this error!!!");
	
	if(fabs(r*cos(th)-rc*cos(thc)) < TINYDIMLESS) errorstop("BUG!\n");
	
	thprime = atan_ratio((r*sin(th)-rc*sin(thc)),(r*cos(th)-rc*cos(thc)));
	rprime = (r*cos(th)-rc*cos(thc))/(cos(thprime));
	
	role = rprime/cell->efben[ic][1];	//r0/lambda0 entrance face
	rols = rprime/cell->efbex[ic][1];	//r0/lambda0 exit face
	
	
	//th = thprime;
	r = rprime;
	//else errorstop("problem in add_field_sector_purebend, rprime and thprime??\n");
	
	//+//compute br, bth, bz		
	if(c1e*role*(ffbe - thprime) < NOOVFLOW_ENGE && c1s*rols*(thprime - ffbs) < NOOVFLOW_ENGE) { //in case you are very far from the magnet, avoid ee and es to averflow the largest double. In this case you will add nothing to *bx, *by and *bz (because you are very far both effective field boundaries)
		
		ee = exp(c1e*role*(ffbe - thprime));
		es = exp(c1s*rols*(thprime - ffbs));
		u = (1 + es)*(1 + ee);
		dudt = c1s*rols*es*(1 + ee) - c1e*role*ee*(1 + es);
		d2udt2 = pow(c1s*rols, 2)*es*(1 + ee) - 2*c1s*rols*c1e*role*es*ee + pow(c1e*role, 2)*ee*(1 + es);
		d3udt3 = pow(c1s*rols, 3)*es*(1 + ee) - ee*es*(3*pow(c1s*rols, 2)*c1e*role - 3*c1s*rols*pow(c1e*role, 2)) - pow(c1e*role, 3)*ee*(1 + es);
		d4udt4 = pow(c1s*rols, 4)*es*(1 + ee) - ee*es*(4*pow(c1s*rols, 3)*c1e*role - 6*pow(c1s*rols, 2)*pow(c1e*role, 2) + 4*c1s*rols*pow(c1e*role, 3)) + pow(c1e*role, 4)*ee*(1 + es);

		b = bz0;
		dbdr = 0.; //radial componant of the mid-plane Bz field
		d2bdr2 = 0.; //and its derivatives...
		d3bdr3 = 0.;
		d4bdr4 = 0.;
		
		f = 1/u; //flutter
		dfdt = -dudt/(u*u); //dflutter/dth
		d2fdt2 = (2*dudt*dudt - u*d2udt2)/(u*u*u); //d2flutter/dth2
		d3fdt3 = (6*u*dudt*d2udt2 - u*u*d3udt3 - 6*dudt*dudt*dudt)/(u*u*u*u); //d3flutter/dth3
		d4fdt4 = (u*(6*u*d2udt2*d2udt2 - u*u*d4udt4 + 4*u*dudt*d3udt3 - 12*dudt*dudt*d2udt2) - 4*dudt*(6*u*dudt*d2udt2 - u*u*d3udt3 - 6*dudt*dudt*dudt))/(u*u*u*u*u); //d4flutter/dth4
		
		//derivatives of the mid-plane Bz field /dr and /dth
		dbzdr	= f*dbdr;
		d2bzdr2	= f*d2bdr2;
		d3bzdr3	= f*d3bdr3;
		d4bzdr4	= f*d4bdr4;
		//dbzdr	= 0.;
		//d2bzdr2	= 0.;
		//d3bzdr3	= 0.;
		//d4bzdr4	= 0.;
		
		dbzdt	= b*dfdt;
		d2bzdt2	= b*d2fdt2;
		d3bzdt3	= b*d3fdt3;
		d4bzdt4	= b*d4fdt4;
	
		//derivatives /dz used to get the coeff. of the Taylor expansion
		dbrdz	= dbzdr;
		dbtdz	= 1/r*dbzdt;
		d2bzdz2	= -1/r*dbzdr - d2bzdr2 - 1/(r*r)*d2bzdt2;
		d3brdz3	= 2/(r*r*r)*d2bzdt2 - d3bzdr3  +  1/(r*r)*dbzdr - 1/r*d2bzdr2 - 1/(r*r)*d2fdt2*dbdr;
		d3btdz3 = -1/r*d2bdr2*dfdt - 1/(r*r*r)*d3bzdt3 - 1/(r*r)*dfdt*dbdr;
		d4bzdz4	= 1/(r*r*r*r)*d4bzdt4 + d4bzdr4 + 2/(r*r)*d2bdr2*d2fdt2 + 2/r*d3bzdr3 - 2/(r*r*r)*d2fdt2*dbdr - 1/(r*r)*d2bzdr2 + 1/(r*r*r)*dbzdr + 4/(r*r*r*r)*d2bzdt2;
		
		//compute br, bth
		//br  = z*dbrdz;
		//bth = z*dbtdz;
		br  = z*dbrdz + z*z*z/6.*d3brdz3;
		bth = z*dbtdz + z*z*z/6.*d3btdz3;
		
		//add contribution of this component onto the bfield in the Cell (componants of b field in the local cartesian framework)
		*bx += br*cos(thprime) - bth*sin(thprime);
		*by += bth*cos(thprime) + br*sin(thprime);
		//*bz += f*b + z*z/2.*d2bzdz2;
		*bz += f*b + z*z/2.*d2bzdz2 + z*z*z*z/24.*d4bzdz4;
		if(fabs(*bz)>1500.) {
			printf("bz = %le, %le, %le, %le, %le\n", *bz, f, d2bzdz2, rprime, r);
			printf("%le, %le, %le, %le, %le, %le\n", es, c1s,rols, ffbs,thprime, thc);
			printf("%le, %le, %le, %le, %le, %le\n\n", ee, c1e,role, ffbe,thprime, thc);
		}
	}
}

//NOT working?
extern void add_field_sector_purebend_lin(double x, double y, double z, double *bx, double *by, double *bz, struct Cell *cell, int ic)
{
	double r, rprime, rc, th, thc, thprime, bz0, ffbe, ffbs, thfringe_e, thfringe_s, br, bth, bz_local, bz_peak;
	//double zeta0, r0;
	
	r = sqrt(x*x + y*y);
	th = atan_ratio(y, x);
	thc = cell->mpara[ic][0];
	//r0 = cell->mpara[ic][1];
	bz0 = cell->mpara[ic][2];
	rc = cell->mpara[ic][3];
	//zeta0 = cell->mpara[ic][4];		//[rad]
	ffbe = cell->mpara[ic][0] + cell->efben[ic][0];
	ffbs = cell->mpara[ic][0] + cell->efbex[ic][0];
	//printf("ffbe = %lf, ffbs = %lf\n", ffbe, ffbs);
	
	if(fabs(r*cos(th)-rc*cos(thc)) < TINYDIMLESS) errorstop("bug in add_field_sector_purebend_lin\n");
	thprime = atan_ratio((r*sin(th)-rc*sin(thc)),(r*cos(th)-rc*cos(thc)));
	rprime = (r*cos(th)-rc*cos(thc))/(cos(thprime));
	
	thfringe_e = cell->efben[ic][1]; //[rad]
	thfringe_s = cell->efbex[ic][1]; //[rad]
	//printf("thfringe_e = %lf, thfringe_s = %lf\n", thfringe_e, thfringe_s);
	br = 0;
	bth = 0;
	bz_local = 0;
	bz_peak = bz0;
	//compute br, bth, bz
	if(thfringe_e != 0 && thprime >= ffbe - thfringe_e && thprime < ffbe + thfringe_e) {
		bz_local = bz_peak*((thprime - ffbe + thfringe_e)/(2.*thfringe_e));
		br = 0.;
		bth = z/rprime*bz_peak/(2.*thfringe_e); 
	}
	else if(thprime >= ffbe + thfringe_e && thprime <= ffbs - thfringe_s) {
		bz_local = bz_peak;
		br = 0.;
		bth = 0;
	}
	else if(thfringe_s != 0 && thprime > ffbs - thfringe_s && thprime <= ffbs + thfringe_s) {
		bz_local = bz_peak*(1 - (thprime - ffbs + thfringe_s)/(2.*thfringe_s));
		br = 0.;
		bth = -z/rprime*bz_peak/(2.*thfringe_s); 
	}
	
	//add contribution of this component onto the bfield in the Cell (components of b field in the local cartesian framework)
	*bx += br*cos(thprime) - bth*sin(thprime);
	*by += bth*cos(thprime) + br*sin(thprime);
	*bz += bz_local;
}

extern void add_field_comp_quad_he (double x, double y, double z, double *bx, double *by, double *bz, struct Cell *cell, int ic)
{
	double ffbe, ffbs, x0, g;

	(void)by;
	//use component parameters
	ffbe = cell->mpara[ic][0] + cell->efben[ic][0];
	ffbs = cell->mpara[ic][0] + cell->efbex[ic][0];
	x0 = cell->mpara[ic][1];
	g = cell->mpara[ic][2];
	
	if(y >= ffbe && y <= ffbs) {
		*bz += -g*(x - x0);
		*bx += -g*z;
	}
}

extern void add_field_comp_quad_lin(double x, double y, double z, double *bx, double *by, double *bz, struct Cell *cell, int ic)
{
	double ffbe, ffbs, x0, g, lambda_e, lambda_s;
	
	//use component parameters
	ffbe = cell->mpara[ic][0] + cell->efben[ic][0];
	ffbs = cell->mpara[ic][0] + cell->efbex[ic][0];
	x0 = cell->mpara[ic][1];
	g = cell->mpara[ic][2];
	lambda_e = cell->efben[ic][1];
	lambda_s = cell->efbex[ic][1];
	
	if(ffbs - ffbe < lambda_e + lambda_s) printf("!Warning in add_field_comp_quad_lin: magnet length < lambda_e + lambda_s !\n");
	
	if(lambda_e != 0 && y >= ffbe - lambda_e && y < ffbe + lambda_e) {
		*bx += -g*z*((y - ffbe + lambda_e)/(2.*lambda_e));
		*by += -g*z*(x-x0)/(2.*lambda_e);
		*bz += -g*(x-x0)*((y - ffbe + lambda_e)/(2.*lambda_e));
	}
	else if(y >= ffbe + lambda_e && y <= ffbs - lambda_s) {
		*bx += -g*z;
		*by += 0;
		*bz += -g*(x-x0);
	}
	else if(lambda_s != 0 && y > ffbs - lambda_s && y <= ffbs + lambda_s) {
		*bx += -g*z*(1 - (y - ffbs + lambda_s)/(2.*lambda_s));
		*by += g*z*(x-x0)/(2.*lambda_s);
		*bz += -g*(x-x0)*(1 - (y - ffbs + lambda_s)/(2.*lambda_s));
	}
}

extern void add_field_comp_quad_enge(double x, double y, double z, double *bx, double *by, double *bz, struct Cell *cell, int ic)
{
	double ffbe, ffbs, x0, g, lambda_e, c1e, lambda_s, c1s, ae, as,
		ee, es, u, dudy, d2udy2, d3udy3, d4udy4, f, dfdy, d2fdy2, d3fdy3, d4fdy4,		
		b, dbdx, d2bdx2, d3bdx3, d4bdx4,
		dbzdx, d2bzdx2, d3bzdx3, d4bzdx4, dbzdy, d2bzdy2, d3bzdy3, d4bzdy4,
		dbxdz, dbydz, d2bzdz2, d3bxdz3, d3bydz3, d4bzdz4;
		
	//errorstop("Enge for quads not implemented yet");
	if(cell->efben[ic][2] != 0 || cell->efbex[ic][2] != 0) errorstop("!!!ERROR in add_field_comp_quad_enge, kappa != 0, this case has not yet been implemented!!!");
	
	//use component parameters
	ffbe = cell->mpara[ic][0] + cell->efben[ic][0];
	ffbs = cell->mpara[ic][0] + cell->efbex[ic][0];
	x0 = cell->mpara[ic][1];
	g = cell->mpara[ic][2];
	lambda_e = cell->efben[ic][1];
	c1e = cell->efben[ic][3];		//enge coeff. c1 entrance face
	lambda_s = cell->efbex[ic][1];
	c1s = cell->efbex[ic][3];		//enge coeff. c1 exit face
	
	
	//+//compute bx, by, bz
	ae = c1e/lambda_e;
	as = c1s/lambda_s;
	
	if(ae*(ffbe - y) < NOOVFLOW_ENGE && as*(y - ffbs) < NOOVFLOW_ENGE) { //in case you are very far from the magnet, avoid ee and es to averflow the largest double. In this case you will add nothing to *bx, *by and *bz (because you are very far both effective field boundaries)
		
		ee = exp(ae*(ffbe - y));
		es = exp(as*(y - ffbs));
		u = (1 + es)*(1 + ee);
		dudy = as*es*(1 + ee) - ae*ee*(1 + es);
		d2udy2 = pow(as, 2)*es*(1 + ee) - 2*as*ae*es*ee + pow(ae, 2)*ee*(1 + es);
		d3udy3 = pow(as, 3)*es*(1 + ee) - ee*es*(3*pow(as, 2)*ae - 3*as*pow(ae, 2)) - pow(ae, 3)*ee*(1 + es);
		d4udy4 = pow(as, 4)*es*(1 + ee) - ee*es*(4*pow(as, 3)*ae - 6*pow(as, 2)*pow(ae, 2) + 4*as*pow(ae, 3)) + pow(ae, 4)*ee*(1 + es);	
	
		b = -g*(x-x0);
		dbdx = -g;
		d2bdx2 = 0;
		d3bdx3 = 0;
		d4bdx4 = 0;
		
		f = 1/u; //flutter
		dfdy = -dudy/(u*u); //dflutter/dy
		d2fdy2 = (2.*dudy*dudy - u*d2udy2)/(u*u*u); //d2flutter/dy2
		d3fdy3 = (6.*u*dudy*d2udy2 - u*u*d3udy3 - 6.*dudy*dudy*dudy)/(u*u*u*u); //d3flutter/dy3
		//d4fdy4 = (u*(6*u*d2udy2*d2udy2 - u*u*d4udy4 + 4*u*dudy*d3udy3 - 12*dudy*dudy*d2udy2) - 4*dudy*(6*u*dudy*d2udy2 - u*u*d3udy3 - 6*dudy*dudy*dudy))/(u*u*u*u*u); //d4 flutter/dy4
		d4fdy4 = (6.*u*u*d2udy2*d2udy2 - 36.*u*dudy*dudy*d2udy2 - u*u*u*d4udy4 + 24.*dudy*dudy*dudy*dudy + 8.*u*u*dudy*d3udy3)/(u*u*u*u*u); //d4 flutter/dy4
	
		//derivatives of the mid-plane Bz field /dx and /dy
		dbzdx	= f*dbdx;
		d2bzdx2 = f*d2bdx2;
		d3bzdx3 = f*d3bdx3;
		d4bzdx4 = f*d4bdx4;
		dbzdy	= b*dfdy;
		d2bzdy2 = b*d2fdy2;
		d3bzdy3 = b*d3fdy3;
		d4bzdy4 = b*d4fdy4;
	
		//derivatives /dz used to get the coeff. of the Taylor expansion
		dbxdz	= dbzdx;
		dbydz	= dbzdy;
		d2bzdz2 = - d2bzdx2 - d2bzdy2;
		d3bxdz3 = - d3bzdx3 - dbdx*d2fdy2;
		d3bydz3 = - d3bzdy3 - d2bdx2*dfdy;
		d4bzdz4 = d4bzdx4 + 2.*d2bdx2*d2fdy2 + d4bzdy4;
	
		*bx += z*dbxdz + z*z*z/6.*d3bxdz3;
		*by += z*dbydz + z*z*z/6.*d3bydz3;
		*bz += f*b + z*z/2.*d2bzdz2 + z*z*z*z/24.*d4bzdz4;
	}
}

extern void add_field_comp_FFAGtilt_he(double x, double y, double z, double *bx, double *by, double *bz, struct Cell *cell, int ic)
{
	double r, th, th0, r0, k1, k2, bz0, zeta0, ffbe, ffbs;
	
	(void)z;
	(void)bx;
	(void)by;
	r = sqrt(x*x + y*y);
	th = atan_ratio(y, x);
	r0 = cell->mpara[ic][1];
	bz0 = cell->mpara[ic][2];
	k1 = cell->mpara[ic][3];
	k2 = cell->mpara[ic][4];
	zeta0 = cell->mpara[ic][5];
	ffbe = cell->mpara[ic][0] + cell->efben[ic][0];
	ffbs = cell->mpara[ic][0] + cell->efbex[ic][0];
	
	th0 = th + asin(r0*sin(zeta0)/r) - zeta0;
	//printf("th = %lf, r = %lf, th0 = %lf\n", th, r, th0);
	
	if (ffbe <= th0 && ffbs >= th0) *bz +=bz0*pow(r/r0, k1)*exp(k2*(zeta0-PI/2.+acos(r0*sin(zeta0)/r)));
	//printf("r = %lf, th = %lf, testex = %lf, testen = %lf, test = %lf, bz += %lf\n", r, th, testex, testen, test, *bz);
}

