extern void add_field_comp_FFAGtilt_lin(double x, double y, double z, double *bx, double *by, double *bz, struct Cell *cell, int ic)
{
	double r, th, th0, r0, k1, k2, bz0, zeta0, r0sz0, ffbe, ffbs, thfringe_e, thfringe_s, br, bth, bz_local, bz_peak;
	
	r = sqrt(x*x + y*y);
	th = atan_ratio(y, x);
	r0 = cell->mpara[ic][1];
	bz0 = cell->mpara[ic][2];
	k1 = cell->mpara[ic][3];
	k2 = cell->mpara[ic][4];
	zeta0 = cell->mpara[ic][5];		//[rad]
	
	r0sz0 = r0*sin(zeta0);
	ffbe = cell->mpara[ic][0] + cell->efben[ic][0];
	ffbs = cell->mpara[ic][0] + cell->efbex[ic][0];
	//printf("ffbe = %lf, ffbs = %lf\n", ffbe, ffbs);
	
	th0 = th + asin(r0sz0/r) - zeta0;
	
	thfringe_e = cell->efben[ic][1]; //[rad]
	thfringe_s = cell->efbex[ic][1]; //[rad]
	//printf("thfringe_e = %lf, thfringe_s = %lf\n", thfringe_e, thfringe_s);
	br = 0;
	bth = 0;
	bz_local = 0;
	bz_peak = bz0*pow(r/r0, k1)*exp(k2*(zeta0-PI/2.+acos(r0sz0/r)));
	
	//compute br, bth, bz
	if(thfringe_e != 0 && th0 >= ffbe - thfringe_e && th0 < ffbe + thfringe_e) {
		bz_local = bz_peak*((th0 - ffbe + thfringe_e)/(2.*thfringe_e));
		br = z*bz_peak/(r*2.*thfringe_e)*((k1 + k2*r0sz0/(sqrt(r*r-r0sz0*r0sz0)))*(th0 - ffbe + thfringe_e) - r0sz0/(sqrt(r*r-r0sz0*r0sz0)));
		bth = z/r*bz_peak/(2.*thfringe_e); 
		//br=0;
		//bth=0;
	}
	else if(th0 >= ffbe + thfringe_e && th0 <= ffbs - thfringe_s) {
		bz_local = bz_peak;
		br = z*bz_peak/r*(k1 + k2*r0sz0/(sqrt(r*r-r0sz0*r0sz0)));
		//br=0;
		bth = 0;
	}
	else if(thfringe_s != 0 && th0 > ffbs - thfringe_s && th0 <= ffbs + thfringe_s) {
		bz_local = bz_peak*(1 - (th0 - ffbs + thfringe_s)/(2.*thfringe_s));
		br = z*bz_peak/r*((k1 + k2*r0sz0/(sqrt(r*r-r0sz0*r0sz0)))*(1 - (th0 - ffbs + thfringe_s)/(2.*thfringe_s)) + r0sz0/(2.*thfringe_s*sqrt(r*r-r0sz0*r0sz0)));
		bth = -z/r*bz_peak/(2.*thfringe_s); 
		//br=0;
		//bth=0;
	}
	
	//add contribution of this component onto the bfield in the Cell (components of b field in the local cartesian framework)
	*bx += br*cos(th) - bth*sin(th);
	*by += bth*cos(th) + br*sin(th);
	*bz += bz_local;
	//printf("r = %lf, th = %lf, bz += %lf\n", r, th, *bz);
}

