	else itp = it + 1;
	if(iz == cell->map.nnodes[2] - 1) izp = iz;
	else izp = iz + 1;
	
	r2 = pow(ir*cell->map.stepsize[0] + cell->map.mapdim[0], 2);
	rp2 = pow(irp*cell->map.stepsize[0] + cell->map.mapdim[0], 2);
	dumr = (r*r - r2)/(rp2 - r2);
	dumt = (th - cell->map.mapdim[2])/cell->map.stepsize[1] - it;
	if(cell->map.sym == YES) dumz = fabs(z/cell->map.stepsize[2]) - iz;
	else dumz = (z - cell->map.mapdim[4])/cell->map.stepsize[2] - iz;
	
	//printf("\nx=%le, y=%le, z=%le\n",x,y,z);
