							d12udy12 = deru_dt(ay12,ay11,p);
							d12fdy12 = d12fdx12dy0(u, dudy, d2udy2, d3udy3, d4udy4, d5udy5, d6udy6, d7udy7, d8udy8, d9udy9, d10udy10, d11udy11, d12udy12);
							m12 = m10*m2;
							f12 = (d12fdy12 + 6*m2*d10fdy10 + 15*m4*d8fdy8 + 20*m6*d6fdy6 + 15*m8*d4fdy4 + 6*m10*d2fdy2 + m12*f)/479001600.;
							x11 = x10*x;
							x12 = x11*x;
							d13udy13 = deru_dt(ay13,ay12,p);
							d13fdy13 = d13fdx13dy0(u, dudy, d2udy2, d3udy3, d4udy4, d5udy5, d6udy6, d7udy7, d8udy8, d9udy9, d10udy10, d11udy11, d12udy12, d13udy13);
							f13 = (d13fdy13 + 6*m2*d11fdy11 + 15*m4*d9fdy9 + 20*m6*d7fdy7 + 15*m8*d5fdy5 + 6*m10*d3fdy3 + m12*dfdy)/479001600.;
							bxtemp = b/m*12.*f12*x11;
							bytemp = b/m*f13*x12;
							bztemp = b*f12*x12;
							*bx += bxtemp;
							*by += bytemp;
							*bz += bztemp;
							//printf("temp12: (%le,%le,%le)\n", bxtemp,bytemp,bztemp);
