								m14 = m12*m2;
								f14 = -(d14fdy14 + 7*m2*d12fdy12 + 21*m4*d10fdy10 + 35*m6*d8fdy8 + 35*m8*d6fdy6 + 21*m10*d4fdy4 + 7*m12*d2fdy2 + m14*f)/87178291200;
								x13 = x12*x;
